import React from 'react';
import { View, StyleSheet } from 'react-native';

const Home = () => {
    return (
        <View style={styles.home}>
            <View style={home_Box}></View>
        </View>
    );
}

const styles = StyleSheet.create({
    home: {
        width: "100vw",
        height: '100vh',
        backgroundColor: "#808080"
    },
    home_Box: {
        width: "100vw",
        height: '100vh',
        backgroundColor: "#808080"
    }
})

export default Home;
